  \"Contaminants in white-tailed deer tissue from the Great Swamp National Wildlife
  Refuge Morris and Somerset Counties, New Jersey: Results of 1988 sampling and analysis\",\n\t\"tracking_summary\":
  {\n\t\t\"total\": 24,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2016-07-27T22:41:54.521820\",\n\t\"name\": \"contaminants-in-white-tailed-deer-tissue-from-the-great-swamp-national-wildlife-refuge-mor\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"White-tailed deer (Odocoileus virginianus)
  tissues were sampled during the December, 1988, public deer hunt at the Great Swamp
  National Wildlife Refuge (GSNWR) to quantify levels of environmental contaminants
  present in the resident deer population and assess human health risks associated
  with consumption of venison. The study was designed to cover a range of age groups
  for both sexes. Sections of 32 deer livers were analyzed for cadmium by the New
  Jersey Department of Environmental Protection (NJDEP). Additional sections of 30
  of these deer livers were analyzed by the U.S. Fish and Wildlife Service (Service)
  for a full scan of trace metals. Ten samples of muscle tissue were analyzed for
  trace metals, organochlorine pesticides, and polycholrinated biphenyls (PCBs). Thirty
  samples of adipose (fatty) tissue were also sampled for organochlorine pesticides
  and PCBs. Levels of organochlorine pesticides and PCBs in muscle tissue were all
  below detection level. Levels of metals in muscle tissue were not indicative of
  contamination or high enough to pose a threat to human health. In liver tissue,
  where metals are selectively concentrated, the median and maximum levels of cadmium
  and other metals were not high enough to be indicative of contamination or to pose
  a threat to human health. Low levels of contaminants observed and lack of strong
  patterns in the data suggest an absence of localized contamination problems in the
  resident deer populations of the local management units within the GSNWR.\",\n\t\"license_title\":
